import React from "react";
import styled from "styled-components";

// Components
import { InforPerfil } from "../components";

function Users() {
  return (
    <Container>
      <Content>
        <InforPerfil
          photo="assets/Perfil.png"
          name="Rick Bone Junior"
          link="@rickbonejr"
          seguidores="109"
          seguidor=""
          favoritos=""
          sobre=""
          empresa=""
          endereco=""
          site=""
          destaque=""
        ></InforPerfil>
      </Content>
    </Container>
  );
}
const Container = styled.div`
  color: #fff;
  background: #ededed;
  width: 100%;
  height: 100%;
  position: fixed;
  display: flex;
  justify-content: center;
  align-items: center;
`;
const Content = styled.div`
  background-color: #fff;
  box-shadow: 0px 0px 5px #b3b3b3;
  color: #fff;
  display: flex;
  position: relative;
  flex-direction: column;
  overflow: hidden;
  width: calc(100% - 20%);
  height: 100%;
`;
export default Users;
